webpackJsonp([0xe0fdaa1ad337],{459:function(e,o){e.exports={data:{site:{siteMetadata:{title:"Blog by Michael Lancaster",subtitle:"Software Engineer focused in Javascript applications",copyright:"© All rights reserved.",author:{name:"Michael Lancaster",twitter:"weblancaster"},url:"http://www.bymichaellancaster.com"}},markdownRemark:{id:"/Users/michaellancaster/Sites/github/michaellancaster-blog/src/pages/articles/2014-05-13-soundnode-soundcloud-for-desktop-dev-release/index.md absPath of file >>> MarkdownRemark",html:'<p>Last night I decided to release as beta version for Developer a project I have been working in the last week and make available as Open Source.</p>\n<h2>Intro..</h2>\n<p>Three years ago I started work as a developer and one of the things I have been using since then is <a href="http://www.soundcloud.com" target="_blank" title="Soundcloud">Soundcloud</a> I used to use their desktop application till the day they stopped support it. to know more about it <a href="http://blog.soundcloud.com/2011/01/06/desktop/" target="_blank" title="Soundcloud desktop support">here</a>.</p>\n<p>Turns out that I miss my native shortcuts while listening to Soundcloud on the web browser.. Therefore I decided to solve my problem but also release as open source so contributors can suggest “new” features.. and here it is.</p>\n<h2>Soundnode App</h2>\n<p><a href="http://www.soundnodeapp.com" target="_blank" title="Soundnode App - Soundcloud for desktop">Soundnode App</a> is a open source project to support Soundcloud for desktop (Windows/Mac) built with Node-Webkit, Node.js Angular.js and consuming Soundcloud API.</p>\n<h2>Why beta Developer release</h2>\n<p>I built the core but I have been working on other projects in parallel and I still want to release Soundnode App as fast as I can to the public so I thought that the community would help to get this project going faster than one man.</p>\n<p>The project is on the Github <a href="https://github.com/Soundnode/soundnode-app" target="_blank" title="Soundnode App - Soundcloud for desktop">Soundnode App</a>.\nConstructive (or not) feedback is always welcome.</p>\n<p>Cheers!</p>',fields:{date:"2014-05-13"},frontmatter:{title:"Soundnode App - Soundcloud for Desktop developer release",description:"Last night I decided to release as beta version for Developer a project I have been working in the last week and make available as Open Source."}}},pathContext:{slug:"/articles/2014-05-13-soundnode-soundcloud-for-desktop-dev-release/"}}}});
